    // https://github.com/rafgraph/spa-github-pages
    // This script checks to see if a redirect is present in the query string, converts it back into the correct url
    // and adds it to the browser's history using window.history.replaceState(...), which won't cause the browser to attempt to load the new url.
    // When the single page app is loaded further down in this file, the correct url will be waiting in the browser's history for the single page app to route accordingly.
    (function(l) {
      if (l.search[1] === '/' ) {
        let decoded = l.search.slice(1).split('&').map(function(s) {
          return s.replace(/~and~/g, '&')
        }).join('?');

            l.pathname.slice(0, -1) + decoded + l.hash
        );
      }
